import React, { useEffect, useMemo, useState } from 'react'
import Cards from '../components/Cards'
import Footer from '../components/Footer'
import Header from '../components/Header'
import SideBar from '../components/SideBar'
import '../styles/Main.scss'

/**
* @author
* @function Home
**/

const Home = (props) => {
    const data_from_db = []
    const [dataCheck, setDataCheck] = useState([])
    const [length, setLength] = useState(0)
    const check = () =>{
        dataCheck.map((data) =>{
            console.log(data)
        })
    }



    var off_obj = {}
    var i

    useEffect(()=>{
        fetch('https://bottlecapdev.pythonanywhere.com/test',{
            method: 'GET',
            headers: {'Content-Type': 'application/json',}
        }).then(response => response.json())
        .then((resp)=>{
            for(i=0; i<resp.id.length; i++){
                data_from_db.push({'id':resp.id[i], 'name': resp.name[i], 'address': resp.address[i], 'province': resp.province[1], 'email': resp.email[i], 'tel': resp.tel[i], 'points': resp.points[i], 'prize': resp.prize[i], 'ballots': resp.ballots[i]})
                setDataCheck(data_from_db)
            }
            setLength(resp.id.length)
            console.log(resp.id.length)
        })

    },[])




  return(
    <div id='dash_Home'>
        <SideBar />
        <div id='content_holder'>
            <Header />
            <div id='content_wrapper'>
            <Cards total={length}/>
            <div id='table_content'>
            <table> 
                <tbody>
                <tr>
                    <th>Name</th>
                    <th>address</th>
                    <th>province</th>
                    <th>email</th>
                    <th>Tel</th>
                    <th>Points</th>
                    <th>Prize</th>
                    <th>Ballots</th>
                </tr>
                </tbody>
                <tbody>
                {
                    check()
                }

                </tbody>


            </table>
            </div>
            <Footer data={dataCheck}/>

            </div>

        </div>

    </div>
   )

 }

export default Home

